// Sample sizes
const uint32_t mallet_soft_size = 2814;
const uint32_t mallet_med_size = 6423;
const uint32_t mallet_hard_size = 19608;
const uint32_t plectrum_size = 6982;
const uint32_t stick_size = 7633;
const uint32_t bow_attack_size = 7024;

const uint32_t NUM_SAMPLES = 6;

// Sample pointer array for indexed access
const int16_t* const sample_ptrs[] = {
    mallet_soft,
    mallet_med,
    mallet_hard,
    plectrum,
    stick,
    bow_attack,
};

const uint32_t sample_sizes[] = {
    mallet_soft_size,
    mallet_med_size,
    mallet_hard_size,
    plectrum_size,
    stick_size,
    bow_attack_size,
};

// Simple sample player - samples are native 48kHz, no pitch compensation needed
class SamplePlayer {
public:
    SamplePlayer() : phase_(0), phase_inc_(1 << 16), sample_idx_(0), playing_(false) {}
    
    void SetSample(int idx) {
        if (idx >= 0 && idx < static_cast<int>(NUM_SAMPLES)) {
            sample_idx_ = idx;
        }
    }
    
    void SetPitch(float pitch_ratio) {
        // pitch_ratio = 1.0 for original pitch (samples are native 48kHz)
        phase_inc_ = static_cast<uint32_t>(pitch_ratio * 65536.0f);
    }
    
    void Trigger() {
        phase_ = 0;
        playing_ = true;
    }
    
    float Process() {
        if (!playing_) return 0.0f;
        
        const int16_t* data = sample_ptrs[sample_idx_];
        uint32_t length = sample_sizes[sample_idx_];
        uint32_t idx = phase_ >> 16;
        
        if (idx >= length - 1) {
            playing_ = false;
            return 0.0f;
        }
        
        // Linear interpolation
        float frac = static_cast<float>(phase_ & 0xFFFF) / 65536.0f;
        float s1 = static_cast<float>(data[idx]) / 32768.0f;
        float s2 = static_cast<float>(data[idx + 1]) / 32768.0f;
        
        phase_ += phase_inc_;
        return s1 + (s2 - s1) * frac;
    }
    
    bool IsPlaying() const { return playing_; }
    
private:
    uint32_t phase_;
    uint32_t phase_inc_;
    int sample_idx_;
    bool playing_;
};

